  render() {
    return (
      <div>
        <Paper style={{padding:'15px 20px', marginBottom:'20px'}}>
          <Informations/>
        </Paper>
        <Paper style={{padding:'15px 20px'}}>
          <Password/>
        </Paper>
      </div>
    );
  }

}

export default Account
